import './App.css';
import axios from 'axios';
import React, { useState } from 'react';

function App() {
const [data, setData] = useState('');

const submitReceiveData = async () => {
  try {
    const response = await axios.post('/api/math', { input: 'my input' });
    setData(response.data)
  } catch (error) {
    console.error('Error:', error);
  }
};
  return (
    <div>
    {submitReceiveData()}
    <p>{data}</p>
    </div>
  );

}

export default App;
